import React, { useEffect, useState } from "react";

const Calc = () => {
  const [count, setCount] = useState(0);
  const [calcu, setCalcu] = useState(0);

  useEffect(() => {
    setCalcu(() => {
      return count * 2;
    }, []);
  });
  return (
    <>
      <p>Count : {count}</p>
      <button
        onClick={() => {
          setCount(count + 1);
        }}
      >
        Click Me +{" "}
      </button>
      <p>Calculation : {calcu}</p>
    </>
  );
};

export default Calc;
